  input: '"TEXT","F3XN","C00165688","Please note that there are expenses disclosed
    on Schedule B for Line 21b for which this employee did not meet the definition
    of Federal Election Activity.  Salaries for all other employees were appropriately
    paid from a non-federal account.    Please note that there were no disbursements
    disclosed on Line 30 because we have not made any disbursements for federal election
    activity nor did we have any employee who spent more than 25% of their time in
    connection with a federal election and/or federal election activity.    The transfer
    of funds to our non-federal accounts were for cash flow purposes as noted on the
    report and were not used to finance activities in connection with federal elections
    or any other allocable administrative activity.    The transfer of funds from
    the ASDC Partnership Program to the Party are made on an as-needed basis.  Please
    note that state party committees have been reporting memo entries on Schedule
    A for contributions received by joint fundraising programs during the reporting
    period in which the contribution was received irrespective of when or in what
    amount transfers are made.  Therefore, disclosure of contributions as memo entries
    on Schedule A and disclosure of transfers do not always match the same timeframe.  For
    this transfer, no contribution met the threshold necessary for itemized contributor
    disclosure.    By prior arrangement between the Partys counsel and the FEC, memo
    entries on Schedule A for the ASDC Dollars for Democrats program are disclosed
    on a quarterly basis.  Therefore, memo entries for June-August 2005 will be disclosed
    on the October Monthly report."'
